import React from "react";
import { Bar } from "react-chartjs-2";

const RouteGraph = (props) => {
  const entries = props.entriesByDate;

   if (entries[5] !== undefined) {
    if (Math.round(parseInt(entries[5].time.split(":")[1] / 10) * 10)[3] == 0) {
      console.log(Math.round(parseInt(entries[5].time.split(":")[1] / 10) * 10)[3]);
    }
  }

  if (entries[5] !== undefined) {
    console.log(entries[5].time);
    console.log(Math.round(parseInt(entries[5].time.split(":")[1] / 10) * 10));
    console.log(Math.round(entries[5].time.split(":")[1] / 10) * 10);
  }

  const roundedTimes = entries.map((entry) => {
    console.log(Math.round((entry.time.split(":")[1] / 10) * 10))
    if (Math.round((entry.time.split(":")[1] / 10) * 10) < 5) {
      return `${entry.time.split(":")[0]}:${(
        (Math.round(parseInt(entry.time.split(":")[1]) / 10) * 10) %
        60
      ).toString()}0`;
    } else {
      return `${entry.time.split(":")[0]}:${(
        (Math.round(parseInt(entry.time.split(":")[1]) / 10) * 10) %
        60
      ).toString()}`;
    }
  });

  const uniqueTimes = [...new Set(roundedTimes.map((time) => time))];

  console.log("unique times", uniqueTimes);

  console.log("rounded times", roundedTimes);

  const state = {
    labels: roundedTimes,
    datasets: [
      {
        backgroundColor: "rgba(75,192,192,1)",
        borderColor: "rgba(0,0,0,1)",
        borderWidth: 2,
        data: entries.map((entry) => entry.attendee_count),
      },
    ],
  };

  return (
    <div>
      <Bar
        data={state}
        options={{
          title: {
            display: true,
            text: "Attendee counts over time",
            fontSize: 20,
          },
          legend: {
            display: false,
          },
          scales: {
            xAxes: [
              {
                // labels: entries.map((entry) => entry.time).slice(0, -3),
                // type: "time",
                distribution: "linear",
              },
            ],
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default RouteGraph;
